export default {
  name: 'ConsultList',
  data: function data() {
    return {
      loading: true,
      dialogFormVisible: false,
      search: '',
      currentPage: 1,
      pageSize: 10,
      total: 0,
      tableData: [],
      form: []
    };
  },
  mounted: function mounted() {
    this.onload();
  },
  methods: {
    handleEdit: function handleEdit(index, row) {
      this.form = row;
      this.dialogFormVisible = true;
    },
    handleDelete: function handleDelete(index, zid) {
      var _this = this;

      this.$confirm('此操作将永久删除该数据, 是否继续?', '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function () {
        var params = new URLSearchParams();
        params.append('consultId', zid);

        _this.$http.post(_this.$url + 'consult/delConsult', params).then(function (res) {
          if (res.data.code === 2001) {
            _this.$message({
              message: '删除成功',
              type: 'success'
            });

            _this.onload();
          }

          if (res.data.code === 2004) {
            _this.$message.error('删除失败');
          }
        });
      }).catch(function () {
        _this.$message({
          type: 'info',
          message: '已取消删除'
        });
      });
    },
    handleSizeChange: function handleSizeChange(size) {
      this.pageSize = size;
      this.onload();
    },
    handleCurrentChange: function handleCurrentChange(currentPage) {
      this.currentPage = currentPage;
      this.onload();
    },
    onload: function onload() {
      var _this2 = this;

      var params = new URLSearchParams();
      params.append('page', this.currentPage);
      params.append('limit', this.pageSize);
      this.$http.post(this.$url + 'consult/getConsultList', params).then(function (res) {
        _this2.loading = true;

        if (res.data.code === 2001) {
          console.log('请求成功');
          _this2.tableData = res.data.data;
          _this2.total = res.data.count;
          _this2.loading = false;
        }

        if (res.data.code === 2004) {
          console.log('请求失败');
          _this2.loading = false;
        }
      });
    }
  }
};
